const Popup=({display,setDisplay})=>{
    const style={
        height:display.height,
        width:display.width,
        display:display.display,
        position:'fixed',
        backgroundColor:display.backgroundColor,
        top:'0px',
        left:'0px',
        alignItem:'center',
        justifyContent:'center',
        zIndex:'10000',
        transition:display.transition,
        transform:display.transform,
    }
    return(

    <div style={style}>
        <div style={{position:'absolute',
                                        }}>
            <button 
                onClick={()=>{
                    setDisplay({...display,
                        height:'0%',
                        width:'0%',
                                })
                    setTimeout(()=>{
                        setDisplay({...display,display:'none'})
                    },500)
                                    }}
            >取消</button>
            <button>確認新增</button>
        </div>
    </div>
    )
}
export default Popup;
